import React from "react";
import { Button, Typography, Box, Container } from "@mui/material";

const Client = () => {
  return (
    <Box >
      <Container sx={{ display: "flex", alignItems: "center"  , margin:0,}}>
        <Typography variant="h4" sx={{ fontWeight: 550, flexGrow: 1 , }}>
          Clients
        </Typography>
        <Button
          sx={{
            backgroundColor: "#f44336",
            color: "white",
            textTransform: "none",
            padding: "8px 16px",
            borderRadius: "4px",
            "&:hover": {
              backgroundColor: "#d32f2f",
            },
          }}
        >
          New Client +
        </Button>
    <Box
      sx={{
        mx: 4,
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
      }}
    >
      <Typography component="h1" variant="h5">
        Sign Up
      </Typography>
      <Box noValidate sx={{ mt: 1 }}>
        <TextField
          margin="normal"
          required
          fullWidth
          id="username"
          label="username"
          name="username"
          autoFocus
          onChange={onChange}
          helperText={errors.username} 
          value={formData.username} 
          error={!!errors.username} 
         
        />
        <TextField
          margin="normal"
          required
          fullWidth
          id="email"
          label="email"
          name="email"
          onChange={onChange}
          helperText={errors.email} 
          value={formData.email} 
          error={!!errors.email} 
        />
         {/* <TextField
          margin="normal"
          required
          fullWidth
          id="publicAddress"
          label="publicAddress"
          name="publicAddress"
          value={formData.publicAddress}
          disabled
        /> */}
        <FormControl>
          <RadioGroup
            row
            aria-labelledby="demo-row-radio-buttons-group-label"
            name="row-radio-buttons-group"
            onChange={handleUserNatureChange}
          >
            <FormControlLabel
              value="admin"
              control={<Radio />}
              label="admin"
            />
            <FormControlLabel
              value="employer"
              control={<Radio />}
              label="employer"
            />
            <FormControlLabel
              value="user"
              control={<Radio />}
              label="user"
            />
          </RadioGroup>
        </FormControl>
        {formData.role == "admin" ? (
          <TextField
            margin="normal"
            required
            fullWidth
            name="identifierNumber"
            label="Licence Number"
            id="identifierNumber"
            onChange={onChange}
          />
        ) : formData.role == "employer" ? (
          <TextField
            margin="normal"
            required
            fullWidth
            name="identifierNumber"
            label="Id employer"
            id="identifierNumber"
            onChange={onChange}
          />
        ) : formData.role == "user" ? (
          <TextField
            margin="normal"
            required
            fullWidth
            name="identifierNumber"
            label="id user"
            id="identifierNumber"
            onChange={onChange}
          />
        ) : null}
        <TextField
          margin="normal"
          required
          fullWidth
          name="password"
          label="Password"
          id="password"
          value={formData.password} 
          error={!!errors.password} 
          helperText={errors.password} 
          onChange={onChange}
          type={showPassword ? 'text' : 'password'}
          InputProps={{
            endAdornment: (
                <InputAdornment position="end">
                    <IconButton
                        onClick={togglePasswordVisibility}
                        edge="end"
                    >
                        {showPassword ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                </InputAdornment>
            ),
        }}
        />
         <TextField
          margin="normal"
          required
          fullWidth
          name="confirmPassword"
          label="confirmPassword"
          type="password"
          id="confirmPassword"
          value={formData.confirmPassword} 
          error={!!errors.confirmPassword} 
          helperText={errors.confirmPassword} 
          onChange={onChange}
        />
        <Button
          type="submit"
          fullWidth
          variant="contained"
          sx={{ mt: 3, mb: 1 }}
          onClick={onSignUp}
        
        >
          Sign Up
        </Button>
      </Box>
    </Box>
  );
} 
      </Container>
    </Box>
  );
};

export default Client;
